ller when fullscreen","    scaleforcedwindow = 2,      -- scaling when rendered on a forced window","    vidscale = true,            -- scale the controller with the video?","    valign = 0.8,               -- vertical alignment, -1 (top) to 1 (bottom)","    halign = 0,                 -- horizontal alignment, -1 (left) to 1 (right)","    barmargin = 0,              -- vertical margin of top/bottombar","    boxalpha = 80,              -- alpha of the background box,","                                -- 0 (opaque) to 255 (fully transparent)","    hidetimeout = 500,          -- duration in ms until the OSC hides if no","                                -- mouse movement. enforced non-negative for the","                                -- user, but internally negative is \"always-on\".","    fadeduration = 200,         -- duration of fade out in ms, 0 = no fade","    deadzonesize = 0.5,         -- size of deadzone","    minmousemove = 0,           -- minimum amount of pixels the mouse has to","                                -- move between ticks to make the OSC show up","    iamaprogrammer = false,     -- use native mpv values and disable OSC","                                -- internal track list management (and some","                                -- functions that depend on it)","    layout = \"bottombar\",","    seekbarstyle = \"bar\",       -- bar, diamond or knob","    seekbarhandlesize = 0.6,    -- size ratio of the diamond and knob handle","    seekrangestyle = \"inverted\",-- bar, line, slider, inverted or none","    seekrangeseparate = true,   -- whether the seekranges overlay on the bar-style seekbar","    seekrangealpha = 200,       -- transparency of seekranges","    seekbarkeyframes = true,    -- use keyframes when dragging the seekbar","    title = \"${media-title}\",   -- string compatible with property-expansion","                                -- to be shown as OSC title","    tooltipborder = 1,          -- border of tooltip in bottom/topbar","    