     state.marginsREQ = false","    end","","    if (not state.enabled) then return end","","    if (state.idle) then","","        -- render idle message","        msg.trace(\"idle message\")","        local _, _, display_aspect = mp.get_osd_size()","        if display_aspect == 0 then","            return","        end","        local display_h = 360","        local display_w = display_h * display_aspect","        -- logo is rendered at 2^(6-1) = 32 times resolution with size 1800x1800","        local icon_x, icon_y = (display_w - 1800 / 32) / 2, 140","        local line_prefix = (\"{\\\\rDefault\\\\an7\\\\1a\u0026H00\u0026\\\\bord0\\\\shad0\\\\pos(%f,%f)}\"):format(icon_x, icon_y)","","        local ass = assdraw.ass_new()","        -- mpv logo","        if user_opts.idlescreen then","            for i, line in ipairs(logo_lines) do","                ass:new_event()","                ass:append(line_prefix .. line)","            end","        end","","        -- Santa hat","        if is_december and user_opts.idlescreen and not user_opts.greenandgrumpy then","            for i, line in ipairs(santa_hat_lines) do","                ass:new_event()","                ass:append(line_prefix .. line)","            end","        end","","        if user_opts.idlescreen then","            ass:new_event()","            ass:pos(display_w / 2, icon_y + 65)","            ass:an(8)","            ass:append(\"Drop files or URLs to play here.\")","        end","        set_osd(display_w, display_h, ass.text)","","        if state.showhide_enabled then","            mp.disable_key_bindings(\"showhide\")","            mp.disable_key_bindings(\"showhide_wc\")","            state.showhide_enabled = false","        end","","","    elseif (state.fullscreen and user_opts.showfullscreen)","        or (not state.fullscreen and user_opts.showwindowed) then","","        -- render the OSC","        render()","    else","        -- Flush OSD","        render_wipe()","    end","","    state.tick_last_time = mp.get_time()","","    if state.anitype ~= nil then","        -- state.anistart can be nil - animation should now start, or it can","        -- be a timestamp when it started. state.idle has no animation.","        if not state.idle and","           (not state.anistart or","            mp.get_time() \u003c 1 + state.anistart + user_opts.fadeduration/1000)","        then","            -- animating or starting, or still within 1s past the deadline","            request_tick()","        else","            kill_animation()","        end","    end","end","","function do_enable_keybindings()","    if state.enabled then","        if not state.showhide_enabled then","            mp.enable_key_bindings(\"showhide\", \"allow-vo-dragging+allow-hide-cursor\")","            mp.enable_key_bindings(\"showhide_wc\", \"allow-vo-dragging+allow-hide-cursor\")","        end","        state.showhide_enabled = true","    end","end","","function enable_osc(enable)","    state.enabled = enable","    if enable then","        do_enable_keybindings()","    else","        hide_osc() -- acts immediately when state.enabled == false","        if state.showhide_enabled then","            mp.disable_key_bindings(\"showhide\")","            mp.disable_key_bindings(\"showhide_wc\")","        end","        state.showhide_enabled = false","    end","end","","-- duration is observed for the sole purpose of updating chapter markers","-- positions. live streams with chapters are very rare, and the update is also","-- expensive (with request_init), so it's only observed when we have chapters","-- and the user didn't disable the livemarkers option (update_duration_watch).","function on_duration() request_init() end","","local duration_watched = false","function update_duration_watch()","    local want_watch = user_opts.livemarkers and","                       (mp.get_property_number(\"chapters\", 0) or 0) \u003e 0 and","                       true or false  -- ensure it's a boolean","","    if (want_watch ~= duration_watched) then","        if want_watch then","            mp.observe_property(\"duration\", nil, on_duration)","        else","            mp.unobserve_property(on_duration)","        end","        duration_watched = want_watch","    end","end","","validate_user_opts()","update_duration_watch()","","mp.register_event(\"shutdown\", shutdown)","mp.register_event(\"start-file\", request_init)","mp.observe_property(\"track-list\", nil, request_init)","mp.observe_property(\"playlist\", nil, request_init)","mp.observe_property(\"chapter-list\", \"native\", function(_, list)","    list = list or {}  -- safety, shouldn't return nil","    table.sort(list, function(a, b) return a.time \u003c b.time end)","    state.chapter_list = list","    update_duration_watch()","    request_init()","end)","","mp.register_script_message(\"osc-message\", show_message)","mp.register_script_message(\"osc-chapterlist\", function(dur)","    show_message(get_chapterlist(), dur)","end)","mp.register_script_message(\"osc-playlist\", function(dur)","    show_message(get_playlist(), dur)","end)","mp.register_script_message(\"osc-tracklist\", function(dur)","    local msg = {}","    for k,v in pairs(nicetypes) do","        table.insert(msg, get_tracklist(k))","    end","    show_message(table.concat(msg, '\\n\\n'), dur)","end)","","mp.observe_property(\"fullscreen\", \"bool\",","    function(name, val)","        state.fullscreen = val","        state.marginsREQ = true","        request_init_resize()","    end",")","mp.observe_property(\"border\", \"bool\",","    function(name, val)","        state.border = val","        request_init_resize()","    end",")","mp.observe_property(\"window-maximized\", \"bool\",","    function(name, val)","        state.maximized = val","        request_init_resize()","    end",")","mp.observe_property(\"idle-active\", \"bool\",","    function(name, val)","        state.idle = val","        request_tick()","    end",")","mp.observe_property(\"pause\", \"bool\", pause_state)","mp.observe_property(\"demuxer-cache-state\", \"native\", cache_state)","mp.observe_property(\"vo-configured\", \"bool\", function(name, val)","    request_tick()","end)","mp.observe_property(\"playback-time\", \"number\", function(name, val)","    request_tick()","end)","mp.observe_property(\"osd-dimensions\", \"native\", function(name, val)","    -- (we could use the value instead of re-querying it all the time, but then","    --  we might have to worry about property update ordering)","    request_init_resize()","end)","","-- mouse show/hide bindings","mp.set_key_bindings({","    {\"mouse_move\",              function(e) process_event(\"mouse_move\", nil) end},","    {\"mouse_leave\",             mouse_leave},","}, \"showhide\", \"force\")","mp.set_key_bindings({","    {\"mouse_move\",              function(e) process_event(\"mouse_move\", nil) end},","    {\"mouse_leave\",             mouse_leave},","}, \"showhide_wc\", \"force\")","do_enable_keybindings()","","--mouse input bindings","mp.set_key_bindings({","    {\"mbtn_left\",           function(e) process_event(\"mbtn_left\", \"up\") end,","                            function(e) process_event(\"mbtn_left\", \"down\")  end},","    {\"shift+mbtn_left\",     function(e) process_event(\"shift+mbtn_left\", \"up\") end,","                            function(e) process_event(\"shift+mbtn_left\", \"down\")  end},","    {\"mbtn_right\",          function(e) process_event(\"mbtn_right\", \"up\") end,","                            function(e) process_event(\"mbtn_right\", \"down\")  end},","    -- alias to shift_mbtn_left for single-handed mouse use","    {\"mbtn_mid\",            function(e) process_event(\"shift+mbtn_left\", \"up\") end,","                            function(e) process_event(\"shift+mbtn_left\", \"down\")  end},","    {\"wheel_up\",            function(e) process_event(\"wheel_up\", \"press\") end},","    {\"wheel_down\",          function(e) process_event(\"wheel_do